import React from "react"

function Header(){
    fetch('https://images-api.nasa.gov',{
        method: 'GET'  
    })
     .then((res) => res.json())
     .then((data) => {
        console.log(data);
        return data.results;
     })

     return data.results;

    } 


export default Header
